import "./DebruijnBitUtils.sol";

/* ShyftCacheGraph.sol

    further ideas for parallelization:

    ex: 20 bits
    if there were 5 parameters say
    and the debruijn indexes were still the best way to find the items
    but you wanted a specific set of searches (active, consented, biometric, insured,
    reputation boundary condition reached)

    01000011000100001000

    bound. insur. biome. conse. active
    0100 | 0011 | 0001 | 0110 | 1101

    whatever the final result would be of the cache graph in this sense, the 256 bit word would only contain information
    about the # trust channels / # of parameters. ie. 4 parameters and 256 / 4 = 64 trust channels.

    obviously, the debruijn index would want to be a 64 bit version in that case.

    in any case, assuming active is required, all of the bits are then AND'd with a repeating version of

    1101 | 1101 | 1101 | 1101 | 1101
  & 0100 | 0011 | 0001 | 0110 | 1101
    --------------------------------
  = 0100 | 0001 | 0001 | 0100 | 1101

  the combined "active and consented" is within the (lower endian system) 6th index.

  accounts would both do this procedure with their existing mappings depending on the parameters to be searched, what
  the submap range tolerance would be (if any) for the combinations, and then the comparison would happen within a slice
  of that data range.


  this system would probably be the fastest equivalent of "look up the parameters at runtime and also be able to
  change the parameters without needing to revoke and recompile".

  not sure what the actual cost would look like however.

*/

///@dev | This contract contains the operating system of a fully on-chain asset routing system. It uses fancy (Debruijn) math tricks to
///     | set up and create a number of tables of binary fields representing assignment to the Trust Channel grouping structure.
///     | Users are attested to by Trust Anchors, [ Trust Anchors are associated to Trust Channels ], and the relationship of the Trust
///     | Channels is then additively projected onto the Users own individual mapping.
///     |
///     | When routing assets, these mappings are compared, and if there is a match (cheaply done so by the math tricks), then there is
///     | a return code stating such, and contracts that depend on this function would then send assets.
///     |
///     | There is also a rule system in-transit. This radically effects per-transaction cost, but is capable of extreme flexibility,
///     | as it there are functions from basic asset limit restrictions, to being driven by an external smart contract call with
///     | arbitrary pass/fail logic.

contract ShyftCacheGraph is DebruijnBitUtils, IShyftCacheGraph, DMTrustChannelRules, ITrustChannelRules, ITrustChannelManager_Routing {
    //@note: many of these events are debug-level event structures that relay internal elements of the stack/field structures.
    // more than likely these will be removed for production deployment events.

