    /// @param _firstAddress the first address to check for the Trust Channel route comparison.
    /// @param _secondAddress the second address to check for the Trust Channel route comparison.
    /// @param _trustChannelAddress the Trust Channel to perform the route comparison in reference to.
    /// @dev | The function returns whether the first and second addresses have a Trust Channel route configuration that would allow both of them to send over that.
