    /// @param _foundChannelRulesBitField the Rules for the Trust Channel this calculation is referencing
    /// @param _senderIdentifiedAddress the sender's address
    /// @param _receiverIdentifiedAddress the receiver's address
    /// @param _amount the amount to transmit
    /// @param _bip32X_type the token type that is being transmitted
