    /// @param _requiredActive whether an "active" status is required from the channel
    /// @dev | This function generates the relative trust level of the counterparties in relation to all of the Rules set for this Trust Channel. This function checks for a Verification Policy, Amount Limits per transaction, and also enables external checks (defined by the Multisig administrators to the Trust Channel) via an other smart contract address.
    ///      | Externally referenced smart contracts have the same input/output types as defined in the "getExternalTrustLevel" function.
    /// @return relativeTrustLevel the (relative) trust level of the counterparties in respect to the trust channel's routing rules
    /// @return externalTrustLevel the (external) trust level of the counterparties in respect to the trust channel's routing rules


    function calculateRelativeTrustLevel(   uint32 _trustChannelIndex,
                                            uint256 _foundChannelRulesBitField,
                                            address _senderIdentifiedAddress,
                                            address _receiverIdentifiedAddress,
                                            uint256 _amount,
                                            uint256 _bip32X_type,
                                            bool _requiredConsentFromAllParties,
                                            bool _requiredActive) public override returns(int16 relativeTrustLevel, int16 externalTrustLevel) {
        ITrustChannelManager trustChannelManager = ITrustChannelManager(trustChannelManagerAddress);
        //@note: the mechanism for determining relativeTrustLevel is:
        // 1: start with a "1" if the returnCode from the trustChannelManager's "route" function (meaning that
        //     this trust channel is active) is > 0
        // 2: for each of the rules that are active, see whether that passes checks (value limit etc.)
        //     if it does, add one to the relativeTrustLevel. If not, reduce by one.
        // 3: with the final relativeTrustLevel value here, if it equals the total available, set it to that total.
        //     otherwise, set the result to zero (since not all rules have passed).

        uint256 totalRules;
        uint256 rulesPassed;

        if ((uint256(2)**uint8(trustChannelRulesEnum.VerificationPolicyEnforced)) & _foundChannelRulesBitField != 0) {
            if ((uint256(2)**uint8(trustChannelRulesEnum.AmountLimitsEnforced)) & _foundChannelRulesBitField != 0) {
                totalRules++;

                //check whether the rules' requirement for amount sent to be under or equal to this amount sent.
                if (uint256(trustChannelManager.getTrustChannelRulesStorage(_trustChannelIndex, uint8(trustChannelRulesEnum.AmountLimitsEnforced), 0)) <= _amount) {
                    rulesPassed++;
                }

            }

            if ((uint256(2)**uint8(trustChannelRulesEnum.ExternalRoutingContractEnforced)) & _foundChannelRulesBitField != 0) {
                totalRules++;

//                        if ((uint256(2)**uint8(trustChannelRulesEnum.AssuredAssetsEnabled)) & _foundChannelRulesBitField != 0) {
//                            totalRules++;
//                            rulesPassed++;
//                        }

                bool success;

                (success, externalTrustLevel) = getExternalTrustLevel(_trustChannelIndex, _senderIdentifiedAddress, _receiverIdentifiedAddress, _amount, _bip32X_type, _requiredConsentFromAllParties, _requiredActive);

                if (success == true) {
                    rulesPassed++;
                }
            }
        }

        if (totalRules == 0) {
            relativeTrustLevel = 1;
        } else {
            if (totalRules == rulesPassed) {
                if (totalRules > 32766 - 256) {
                    relativeTrustLevel = 32766;
                } else {
                    relativeTrustLevel = int16(totalRules + 1);
                }
            } else {
                //all rules do not pass
                relativeTrustLevel = 0;
            }
        }

        return (relativeTrustLevel, externalTrustLevel);
    }

