@param _identifiedAddress The end user's smart contract address that attestations are associated to.
 @dev This is a publicly available function that constructs the Cache Graph of the end user. This will call many other internal functions that properly correlate all of the outstanding 'non-dirty' (ie. non updated) attestations, and then create a list of updates and process them sequentially. When this smart contract function call is complete, the associated _identifiedAddress will have been updated with the latest additions/subtractions to the Trust Channel memberships the end user is associated to via attestations.
 @return result
    | 0: no updates needed
    | 1: compilation needs to be complete (more calls to this function are needed to complete the procedure due to gas cost requirements)
    | 2: recompiled hash graph

@param _identifiedAddress The end user's smart contract address that attestations are associated to.
 @param _keccakHash The keccak hash of the attestation that will be compiled into the Cache Graph.
 @param _consentAvailable Whether consent is available, if so also compiles the Consented Cache Graph.
 @dev An internal function to continue the compilation of the Cache Graph for the specific user _identifiedAddress. This function takes a specific attestation (referenced via _keccakHash), gathers the submap index (the position of the 256 bits) for the Trust Anchor that refers to the Trust Channels it has membership in. This function then bakes the bit field of the Trust Channels into the _identifiedAddress's account.

@param _identifiedAddress The end user's smart contract address that attestations are associated to.
 @param _sourceTrustAnchorIndex The Trust Anchor (by Index) that should be removed from this _identifiedAddress's Trust Channel membership mapping.
 @dev An internal function that removes a specific Trust Anchor from the mapping of an _identifiedAddress's Trust Channel group membership. This function iteratively compares the Trust Channel membership of each of the Trust Anchors associated to this _identifiedAddress group membership, and removes any Trust Channels from this group membership that are unique to the Trust Anchor being removed.

@param _identifiedAddress The end user's smart contract address that attestations are associated to.
 @param _idx The attestation (via Index) that will be compiled into the _identifiedAddress's Trust Channel group membership.
 @dev This function initiates the compilation process for a specific _identifiedAddress's attestation (referenced via Index). If this attestation is no longer Approved, there is a mechanism to conditionaly remove the Trust Channel group membership that is associated to the Trust Anchor that initially performed this attestation.

@param trustChannelBitField the 256-bit bit field that the sub-index is retrieved.
 @dev | This function returns the sub-index (the position within a 256-bit window of the total trust channel bitfield) using the most efficient method of finding the leftmost set bit within N bits - the debruijn search algorithm.
      | This function uses a sliding window 32 bits wide (the size of the the debruijn algorithm's search filter) over the 256-bit input bitfield. Further improvements to the debruijn library may result in a 64-bit (or even 256-bit) version of this algorithm. Given gas costs, I believe the cost would be reduced further all the way up to a hypothetical 256-bit version.
 @return result
    0->255 = trust channel sub index.

@param _senderIdentifiedAddress the sender's address
 @param _receiverIdentifiedAddress the receiver's address
 @dev | The function returns the lowest trust channel index that the sender and receiver have in common. Specifically searches the both the "active" directory (which may not be updated given that repeating tasks per-block is not a feature of the ethereum and thus Shyft blockchain), and the "consented" channels. Given that users will have benefit to update the blockchain when they are "active" and thus set that flag, and the opposite when they may lose their active status, there will be a commonly higher proportion of false positives across active & inactive attestations. Consequently, it is the vendors who have the onus on proving that a customer is inactive.
 @dev | As Users of Shyft, there is also the option of proving group membership in the Trust Channels, so this Routing function may become the predominant standard.
      | This function uses a sliding window 256 bits wide, and narrows down the search to the mutually highest and lowest submap indexes both the sender and receiver have in common.
 @return result
      | NoTrustChannel = no trust channel found
      | 0->2**32 - 2 = trust channel found at index

